import React, { Component } from 'react';
import './App.css'
import Letter from './Components/Letter.jsx';


class Home extends Component {

    render() {
        const phrase = "YERI KIM".split('');
        return (
            <div className="main sides pink">

                <div className="board">
                    {phrase.map(letter => (
                        <Letter
                            value={letter}
                        />
                    ))
                    }
                </div>
            </div>
        );
    }
}




export default Home;
